import React from 'react'
import CuerpoFeedBox from '../components/CuerpoFeedBox'

function CuerpoFeed(props) {    
    return(props.dClips.map((dClips) => (<CuerpoFeedBox embedClip={dClips.embed_url} thumbClip={dClips.thumbnail_url} titleClip={dClips.title} urlClip={dClips.url} countClip={dClips.view_count} />))                    
    )
}
export default CuerpoFeed
